import React from "react";
import styled from "styled-components";
import { SmallSubtitle } from "../styled/typos";
const member = props => {
  const dataMember = { props };
  console.log(props.dataMember.subTitle);
  return (
    <Container>
      <SmallSubtitle>{dataMember.subTitle}</SmallSubtitle>
    </Container>
  );
};

export default member;

const Container = styled.div`
  position: relative;
`;
